import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import HeaderTwo from "../../components/common/Header.js";
import { BreadcrumbBox } from "../../components/common/Breadcrumb.js";
import FooterTwo from "../../components/FooterTwo.js";
import { Styles } from "./styles/facilities-details.js";
import DetailsData from "../../data/facilities/facilities-details.json";
import MainFacilitiesData from "../../data/facilities/facilities.json";

class FacilitiesDetails extends Component {
  render() {
    const { match } = this.props;
    const facilityId = match.params.id;

    // Get main facility info for dynamic description
    const mainFacility = MainFacilitiesData.find((item) => item.id === facilityId);

    // Fallback if not found
    if (!mainFacility) {
      return <div>Facility not found</div>;
    }

    // Filter labs/related details
    const filteredDetails = DetailsData.filter((data) => data.id === facilityId);
    const { paragraph, points } = mainFacility.description;

    return (
      <Styles>
        <div className="main-wrapper blog-details-page">
          <HeaderTwo />
          <BreadcrumbBox title={mainFacility.postTitle || "Facility Details"} />

          <section className="blog-details-area">
            <Container>
              <Row>
                <Col lg="11" md="8" sm="7">
                  <div className="blog-details-box">
                    <div className="blog-details-banner">
                      <img
                        src={`${process.env.PUBLIC_URL}/assets/images/blog_c-04.jpg`}
                        alt=""
                        className="img-fluid"
                      />
                    </div>

                    <div className="heading">
                      <h4>Description</h4>
                    </div>
                    <div className="blog-details-desc">
                      <p>{paragraph}</p>
                      <ul className="list-unstyled">
                        {points.map((point, idx) => (
                          <li key={idx}>
                            <i className="fa fa-check"></i> {point}
                          </li>
                        ))}
                      </ul>
                    </div>

                    <div className="blog-details-other-labs">
                      <Row>
                        {filteredDetails.map((data, i) => (
                          <Col md="12" key={i}>
                            <div className="course-item d-flex">
                              <div className="course-image-box">
                                <div
                                  className="course-image"
                                  style={{
                                    backgroundImage: `url(${process.env.PUBLIC_URL}/assets/images/${data.imgUrl})`,
                                  }}
                                ></div>
                              </div>
                              <div className="course-content">
                                <h6 className="heading">
                                  <Link to={process.env.PUBLIC_URL + data.courseLink}>
                                    {data.courseTitle}
                                  </Link>
                                </h6>
                                <p className="desc">{data.courseDesc}</p>
                              </div>
                            </div>
                          </Col>
                        ))}
                      </Row>
                    </div>

                    <div className="blog-tag_share d-flex justify-content-between">
                      <div className="blog-tag">
                        <ul className="tags list-unstyled list-inline">
                          <li className="list-inline-item">Tags:</li>
                          <li className="list-inline-item"><Link to="/">Html</Link>,</li>
                          <li className="list-inline-item"><Link to="/">Design</Link>,</li>
                          <li className="list-inline-item"><Link to="/">Develop</Link>,</li>
                          <li className="list-inline-item"><Link to="/">React</Link></li>
                        </ul>
                      </div>
                      <div className="blog-share">
                        <ul className="social list-unstyled list-inline">
                          <li className="list-inline-item">Share:</li>
                          <li className="list-inline-item"><a href="/"><i className="fab fa-facebook-f"></i></a></li>
                          <li className="list-inline-item"><a href="/"><i className="fab fa-twitter"></i></a></li>
                          <li className="list-inline-item"><a href="/"><i className="fab fa-linkedin-in"></i></a></li>
                          <li className="list-inline-item"><a href="/"><i className="fab fa-youtube"></i></a></li>
                          <li className="list-inline-item"><a href="/"><i className="fab fa-dribbble"></i></a></li>
                        </ul>
                      </div>
                    </div>
                  </div>
                </Col>
              </Row>
            </Container>
          </section>

          <FooterTwo />
        </div>
      </Styles>
    );
  }
}

export default FacilitiesDetails;
